  console.log('musicproposals sorted', sortedArrayOfFriends)
  return (
    <div>
      {sortedArrayOfFriends.map((friend, index) => (
        <MusicBox width={friend.length}></MusicBox>
      ))}
    </div>
  )
}

export default MusicProposals

